Будет ограничено движение автотранспорта по стране, закроют общепиты и другое.

В Узбекистане с 10 июля по 1 августа введут усиленные карантинные меры, следует из решения Республиканской спецкомиссии.
В частности, вводятся следующие меры:
— будет ограничено движение автотранспорта по стране;
— меры не затронут основные виды деятельности государственных органов и организаций. Будет выдан отпуск в установленном законодательном порядке. Будет организована работа оставшейся части в максимально возможной степени (удаленно);
— запретят проведения совещаний в государственных органах, организациях и предприятиях, при необходимости проведение совещаний в режиме видеоконференций;
— запретят движения автотранспорта между регионами (за исключением движения служебных и личных авто, принадлежащих сельхозпроизводителям);
— запретят проведения культурных, семейных, свадебных и других церемонии, публичных мероприятии;
— приостановление деятельности парков;
— приостановят работу крупных вещевых рынков и магазинов;
— приостановится деятельности спортивных залов, фитнес-клубов, тренажеров и бассейнов;
— прекратится работа дошкольных образовательных учреждений, учебных курсов и любых кружков независимо от их организационно-правовых и имущественных форм;
— прекратится работа общепита (рестораны, кафе, столовые, чайханы), за исключением услуг доставки (кейтеринг);
— приостановят работу санаториев, пансионатов, детских лагерей, гостевых домов, пляжей и других мест отдыха.
Кроме этого, людям старше 65 лет запретят находится в общественных местах, также запретят сборы более трех человек.
Также международные чартерные рейсы будут сокращены вдвое. Водители транспортных средств, занимающихся международными перевозками, должны сдать тест на выявление коронавирусной инфекции.
Также согласное решению спецкомиссии карантинный период сокращается с 14 до 10 дней. Если в течение 10 дней результаты теста на коронавирусную инфекцию выйдут отрицательным, пациент выйдет из карантина, если тест положительный, то пациент госпитализируется при наличии симптомов коронавирусной инфекции.
Если симптомов не будет, то лечение будет проводится в домашних условиях. В случае отсутствия условия лечиться дома, то пациент будет госпитализирован.

